import React from 'react'

const Dummy = (props) => {
	const showColor = (e) => {
		const color = e.target.style.background
		let tar = e.target
		let el = document.getElementById("mjs-wrapper")
		el.style.background = color
		e.target.style.background = "#ffffff"
		rePaint = (element, target, color) => {
			element.style.background = "#ffffff"
			target.style.background = color
		}
		setTimeout(repaint, 1000, el,tar,color)
	}
	return (
		<div onClick={showColor} className={props.classnames} style={props.styling}></div>
	)
}

export default Dummy
